import axios from 'axios';
import { FC, useEffect, useState } from 'react';
import AppDashboard from '../../../../feautures/Details/DashboardDetails/AppDashboard';
import DashboardList from '../../../../feautures/Details/DashboardDetails/DashboardList';
import { IProduct } from '../../../models/product';
import SidebarExampleTransitions from '../dashboard';
interface IProps {
    products: IProduct[];
    // selectActivity: (id: string) => void;
    // deleteActivity: (id: string) => void;
  }
 export const Overview = () => { 
    const [products, setActivities] = useState<IProduct[]>([]);

      useEffect(() => {
        axios
          .get<IProduct[]>("http://localhost:5000/api/product")
          .then((response) => {
            let products: IProduct[] = [];
            response.data.forEach((product) => {
              product.productName = product.productName.split(".")[0];
              products.push(product);
            });
            setActivities(products);
          });
      }, []);

      return(
          <div>
                <AppDashboard products={products} />
          </div>

      );


    }

export const Users: FC = () => {
    return <div className="overview">Users</div>;
};

export const Revenue: FC = () => {
    return <div className="overview">Revenue</div>;
};

export const Order: FC = () => {
    return <div className="overview">Order</div>;
};

export const History: FC = () => {
    return <div className="overview">History</div>;
};

export const Configurations: FC = () => {
    return <div className="overview">Configurations</div>;
};
